clear; close all; clc;

% Parameters
N = 5000;
Hvals = [0.3, 0.5, 0.7];
colors = lines(3);

% Preallocate
fbm = cell(1,3);
dh = cell(1,3);
h = cell(1,3);
cp = cell(1,3);
tauq = cell(1,3);
leaders = cell(1,3);
struct = cell(1,3);
% Generate fBm and compute wavelet leader stats
for i = 1:3
    fbm{i} = wfbm(Hvals(i), N);
    [dh{i}, h{i}, cp{i}, tauq{i}, leaders{i}, struct{i}] = dwtleader(fbm{i});
    
end

%% ---------------------------------------------------------
% 1. Plot the fBm signals
% ---------------------------------------------------------
x = 1:N;
figure; %[output:444bb7dd]
hold on; %[output:444bb7dd]
for i = 1:3
    plot(x, fbm{i}, 'LineWidth', 1.2, 'Color', colors(i,:)); %[output:444bb7dd]
end
legend("H=0.3","H=0.5","H=0.7", Location="NorthEast") %[output:444bb7dd]
title("Fractional Brownian Motion") %[output:444bb7dd]
xlabel("n"); ylabel("Amplitude"); grid on %[output:444bb7dd]

%% ---------------------------------------------------------
% 2. Multifractal Spectrum D(h)
% ---------------------------------------------------------
figure; hold on; %[output:07aeff8a]
for i = 1:3
    plot(h{i}, dh{i}, 'LineWidth', 2, 'Color', colors(i,:)); %[output:07aeff8a]
end
xlabel("h"); ylabel("D(h)") %[output:07aeff8a]
title("Multifractal Spectrum") %[output:07aeff8a]
legend("H=0.3","H=0.5","H=0.7", Location="NorthEast") %[output:07aeff8a]
grid on %[output:07aeff8a]

%% ---------------------------------------------------------
% 3. Scaling Function τ(q)
% ---------------------------------------------------------
q = -5:5;
figure; hold on; %[output:32ecc531]
for i = 1:3
    plot(q, tauq{i}, 'LineWidth', 2, 'Color', colors(i,:)); %[output:32ecc531]
end
xlabel("q"); ylabel("\tau(q)") %[output:32ecc531]
title("Scaling Function \tau(q)") %[output:32ecc531]
legend("H=0.3","H=0.5","H=0.7", Location="NorthEast") %[output:32ecc531]
grid on %[output:32ecc531]

% C is a 3×3 matrix: rows = H values, columns = C1,C2,C3
C = cell2mat(cp');   % convert cumulant cell array to matrix

figure; %[output:82869409]
b = bar(C');   % grouped bar chart (C' makes groups = C1,C2,C3) %[output:82869409]
set(gca, 'XTickLabel', {'C1','C2','C3'}) %[output:82869409]
xlabel("Cumulant Order") %[output:82869409]
ylabel("Value") %[output:82869409]
legend("H=0.3","H=0.5","H=0.7", Location="NorthEast") %[output:82869409]
title("Cumulants C_1, C_2, C_3") %[output:82869409]
grid on %[output:82869409]

% ---- Add value labels above each bar ----
xt = b(1).XEndPoints;  % x positions for first group
for k = 1:numel(b) %[output:group:0fe134ed]
    x = b(k).XEndPoints;
    y = b(k).YEndPoints;
    labels = string(round(b(k).YData, 4));  % format values
    text(x, y, labels, ... %[output:82869409]
        'HorizontalAlignment','center', ... %[output:82869409]
        'VerticalAlignment','bottom', ... %[output:82869409]
        'FontSize', 10) %[output:82869409]
end %[output:group:0fe134ed]
Hvals = [0.3, 0.5, 0.7]; % assuming leaders{1}, leaders{2}, leaders{3}
for i = 1:3 %[output:group:2d8ff5df]
    numL = numel(leaders{i});
    rows = ceil(numL/3);

    figure; %[output:73b9f2d6] %[output:34d8545a] %[output:34868336]
    for j = 1:numL
        subplot(rows, 3, j) %[output:73b9f2d6] %[output:34d8545a] %[output:34868336]
        plot(leaders{i}{j}, 'LineWidth', 1.2)
        title("Leader scale j = " + string(j))
        xlabel("Coefficient index")
        ylabel("Leader value")
        grid on
    end

    sgtitle("Wavelet Leaders Across Scales for H = " + string(Hvals(i)))
end %[output:group:2d8ff5df]

